import React, { Component } from "react";
import "./App.scss";
import HomePage from "./Components/HomePage/HomePage";
import NotAboutUs from "./Components/NotAboutUs/NotAboutUs";
import Mantra from "./Components/Mantra/Mantra";
import WhatWeCanDo from "./Components/WhatWeCanDo/WhatWeCanDo";
import "@fortawesome/fontawesome-free/css/all.min.css";
import Showcases from "./Components/ShowCases/Showcases";
import Banner from "./Components/Banner/Banner";
import {BrowserRouter as Router,Route} from 'react-router-dom'

class App extends Component {
  render() {
    return (
      <Router>
        <div id="container">
          <section>
            <div className="wrap page1">
              <HomePage />
            </div>
          </section>
          <section id="NotAboutUs">
            <div className="wrap page2">
              <NotAboutUs />
            </div>
          </section>

          <section id="mantra">
            <div className="wrap page3">
              <Mantra />
            </div>
          </section>

          <section id="wecando">
            <div className="wrap page4">
              <WhatWeCanDo />
            </div>
          </section>

          <section id="showcases">
            <div className="wrap page5">
              <Showcases />
            </div>
          </section>

          <section id="banner">
            <div className="wrap page6">
              <Banner />
            </div>
          </section>
        </div>
        </Router>    );
  }
}
export default App;
